一.html.body:
什么是青矩数据云平台
随着我国工程造价管理模式的变革，未来将逐步淡化预算定额的市场化定价应用，造价咨询企业的数据收集、数据分析、数据分享能力将成为企业的核心竞争力。基于未来变革的需要，公司筹建了青矩数据云平台，为广大员工造价咨询业务实施提供数据支持，共建、共享、共赢，不但提高员工造价成果编审效率，而且大幅提高编审的准确性。
“青矩数据”作为我公司的工程造价大数据平台，利用自主研发的造价数据解析逻辑，建立以科学分类和代码系统为基础的数据库结构，对真实的历史数据进行录入、整理、分析，形成各种造价指标。可为工程项目提供数据比对、分析和相关单项工程的数据支持。目前云平台实现的主要功能包括三个部分，分别是数据查阅、项目创建与分享、和数据比对，本文将在后续章节分别介绍。

